import React, { Component } from 'react';
import { Collapse, Nav, Navbar, NavbarBrand, NavbarToggler, NavItem, NavLink } from 'reactstrap';
import { Link } from 'react-router-dom';

class NavBar extends Component {

  constructor(props) {
    super(props);
    this.state = {isOpen: false};
    this.toggle = this.toggle.bind(this);
  }

  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }

  render() {
    return (
      <Navbar
        className="text-gray-400 bg-gray-900 body-font mb-20"
        color="light"
        light
        expand="md"
      >
        <NavbarBrand tag={Link} to="/">
          Home
        </NavbarBrand>
        <NavbarBrand tag={Link} to="Articles">
          Blogs
        </NavbarBrand>
        <NavItem>
          <NavLink href="/Articles">Blogs</NavLink>
        </NavItem>

        <NavbarToggler onClick={this.toggle} />
        <Collapse isOpen={this.state.isOpen} navbar>
          <Nav className="ml-auto" navbar>
            <NavItem>
              <NavLink href="#about">About</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="#projects">Projects</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="#skills">Skills</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="#testimonials">Testimonials</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="#contact">Say Hi üëãüèº</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="https://github.com/nick-ang">GitHub</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="https://www.linkedin.com/in/nick-c-ang/">
                LinkedIn
              </NavLink>
            </NavItem>
          </Nav>
        </Collapse>
      </Navbar>
    );
  }
}

export default NavBar;
